import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import MainPage from './MainPage';
import StacksPage from './StacksPage';
import StackDetailPage from './StackDetailPage';
import BuildStackPage from './BuildStackPage';
import RunStackPage from './RunStackPage';

const App = () => {
  const [stacks, setStacks] = useState([]);

  return (
    <Router>
      <Routes>
        <Route path="/" exact component={MainPage} />
        <Route path="/stacks" render={() => <StacksPage stacks={stacks} />} />
        <Route path="/stack/:id" render={() => <StackDetailPage stacks={stacks} />} />
        <Route path="/build/:id" component={BuildStackPage} />
        <Route path="/run/:id" component={RunStackPage} />
      </Routes>
    </Router>
  );
};

export default App;
